import React from 'react'
import HomeComp from '../components/HomeComp';
import AboutForHome from '../components/AboutForHome';
import Clinic from '../components/Clinic';
import Treatment from './Treatment';

const Home = () => {
  return (
    <>
      <div style={{ height: '75vh' }}>
        <HomeComp />
      </div>
      <div>
        <AboutForHome />
      </div>
      <div>
        <Clinic />
      </div>
      <div>
        <Treatment />
      </div>
    </>
  )
}

export default Home
